const Next = () => {
    const image = useContext(CapturedImageContext);

    return (
        <div>
            {image?.capturedImage && (
                <img src={image.capturedImage} alt="Background removed" />
            )}
            <Link to="/">Restart</Link>
        </div>
    )
}

export default Next;
